jQuery(function($){
  
  var myLazyLoad = '';
  
  // Mega menu JS MODEL API
  if ($(window).width() > 1024) {
    $(".m-menu .mm-link, .primary-nav .mm-link,.mm-range").on("click", function(e){
      e.preventDefault();
      $('body').toggleClass('mm-active');
      $('body').removeClass('show-menu');
    });

    $(".mega-menu .mm-cross").on("click", function(){
      $('body').removeClass('mm-active');
    });

    $(".mega-menu a").on("mouseover", function(){
      $(".mega-menu").addClass("hover");
    });

    $(".mega-menu a").on("mouseleave", function(){
      $(".mega-menu").removeClass("hover");
    });    
  }
  
  // Car Mega Menu
  $(".mm-newcars").on("mouseclick click", function(e){
    e.preventDefault();
    $(".megamenu").addClass("active");
  });
  
  $(".megamenu").on("mouseleave", function(){
    $(".megamenu").removeClass("active");
  });  

  $('body').on('click', '.a-link', function() {
    if (location.pathname.replace(/^\//,'') == this.pathname.replace(/^\//,'') && location.hostname == this.hostname) {
      var target = $(this.hash);
      target = target.length ? target : $('[name=' + this.hash.slice(1) +']');
      if (target.length) {
        $('html,body').animate({
          scrollTop: target.offset().top
        }, 1000);
        $("body").removeClass("show-menu");
        return false;
      }
    }
  });
  
  $(".primary-nav > ul > li.parent > a:not(.mm-newcars)").on("click", function(e){
    e.preventDefault();
    if(!$(this).parent().hasClass('active')) {
      $(".primary-nav > ul > li.parent.active").removeClass('active');
    }
    $(this).parent().toggleClass('active');
    $(".megamenu, .mm-backdrop").removeClass("active");
  });    
  
  
  // Animation scrolling
  var $animation_elements = $('.animation');
  var $window = $(window);
  
  function check_if_in_view() {
    var window_height = $window.height();
    var window_top_position = $window.scrollTop() - 150;
    var window_bottom_position = (window_top_position + window_height);

    $.each($animation_elements, function() {
      var $element = $(this);
      var element_height = $element.outerHeight();
      var element_top_position = $element.offset().top;
      var element_bottom_position = (element_top_position + element_height);

      //check to see if this current container is within viewport
      if ((element_bottom_position >= window_top_position) &&
          (element_top_position <= window_bottom_position)) {
        $element.addClass('active');
      }
    });
  }
  
  $window.on('scroll resize', check_if_in_view);
  $window.trigger('scroll');    

  // Anchor smooth scrolls
  $('body').on('click', '.a-link', function() {
    if (location.pathname.replace(/^\//,'') == this.pathname.replace(/^\//,'') && location.hostname == this.hostname) {
      var target = $(this.hash);
      target = target.length ? target : $('[name=' + this.hash.slice(1) +']');
      if (target.length) {
        $('html,body').animate({
          scrollTop: target.offset().top
        }, 1000);
        $("body").removeClass("show-menu");
        return false;
      }
    }
  });
  
  // Form scroll down after submission
  if(window.location.href.indexOf('chronoform') > -1) {
    var target = $(".gbs3");
    if (target.length) {
      setTimeout(function(){
        $('html,body').animate({
          scrollTop: (target.offset().top - 150)
        }, 10);
      }, 2000);
    }
  }

  // Prevent parent menu items being clicked
  $(".primary-nav > ul > li.parent > a").on("click", function(e){
    e.preventDefault();
  });
  
  // Mobile menu button
  $("#mobile-button").on("click", function(){
    $("body").toggleClass("show-menu");
  });
  
  // Mobile overlay click, hide menu
  $(".mobile-overlay").on("click", function(){
    $("body").removeClass("show-menu");
  });
  
  // Mobile menu subnav
  $("body").on("click", ".m-menu .parent > a", function(e){
    e.preventDefault();
    $(this).parent().toggleClass("show");
  });
  
  // Fixed menu when scrolling down page
  $(window).on("scroll touchmove", function() {
   var $fromTop = $(window).scrollTop();
    $("body").toggleClass("fixed-menu", ($fromTop > 100));
  });
  
  // Form control toggle empty class if no value
  $(".form-control:not([value]),.form-control[value='']").not('.form-control[type="file"]').addClass('empty');
  $("body").on("input keyup blur", ".form-control", function() { $(this).toggleClass("empty", !Boolean($(this).val())); });
  $("body").on("change", ".select-container select", function() { $(this).parent().toggleClass("active", Boolean($(this).val())); });

  // Check forms for errors before submitting
  $('.chronoform input, .chronoform textarea').each(function(){
    var $this = $(this);
    $this.on('invalid', function(){
      $this.addClass('error');
    });
    $this.on('keydown', function(){
      $this.removeClass('error');
    });
  });
  $('.chronoform select').each(function(){
    var $this = $(this);
    $this.on('invalid', function(){
      $this.parent().addClass('error');
    });
    $this.on('change', function(){
      $this.parent().removeClass('error');
    });
  });

  // Old method of form validation
  $("body").on("click", ".chronoform .form-submit", function(){
    var $errors = false;
    $(this).closest(".chronoform").find(".required").each(function(){
      if($(this).hasClass("select-container")){
        if(!Boolean($(this).find(".select-hide").val())) {
          $(this).addClass("error").focus();
          $errors = true;
          return false;
        }
      }
      else if($(this).hasClass("tickbox")){
        if(!$(this).find("input").is(":checked")) {
          $(this).addClass("error").focus();
          $errors = true;
          return false;
        }
      }
      else if(!Boolean($(this).val())) {
          $(this).addClass("error").focus();
            $errors = true;
          return false;
        }
    });
    if($errors === true) {
      return false;
    }
  });
  
  // Tabs
  $("body").on("click",".tabs-header",function(e){e.preventDefault();var $tabs = $(this).parent(),x=0;while(!$tabs.find(".tabs-content").length && x < 10){$tabs=$tabs.parent();x++;}if($(this).hasClass("active"))$tabs.find(".tabs-content.active,.tabs-header.active").removeClass("active");else{$tabs.find(".tabs-content.active,.tabs-header.active").removeClass("active");var a=$(this).attr("data-tab");$(this).addClass("active"),$tabs.find(".tabs-content."+a).addClass("active");myLazyLoad = new LazyLoad();}});
  
      // Faq Tabs
  $(".faq-header").on("click", function(){
    if($(this).hasClass("active")) {
      $(".faq-content.active,.faq-header.active").removeClass("active");
    }
    else {
      $(".faq-content.active,.faq-header.active").removeClass("active");
      var $header_class = $(this).attr("class").replace("faq-header ", "").replace("dropdown ", "");
      $(this).addClass("active");
      $(".faq-content."+$header_class).addClass("active");
    }
  });
  
   // Staff Tabs
  $(".staff-header").on("click", function(){
    if($(this).hasClass("active")) {
      $(".staff-content.active,.staff-header.active").removeClass("active");
    }
    else {
      $(".staff-content.active,.staff-header.active").removeClass("active");
      var $header_class = $(this).attr("class").replace("staff-header ", "").replace("dropdown ", "");
      $(this).addClass("active");
      $(".staff-content."+$header_class).addClass("active");
    }
  });

  
  // Tabs - Mega Menu
  $(".mm-header").on("click", function(){
    if($(this).hasClass("active")) {
      $(".mm-content.active,.mm-header.active").removeClass("active");
    }
    else {
      $(".mm-content.active,.mm-header.active").removeClass("active");
      var $header_class = $(this).attr("class").replace("mm-header ", "").replace("dropdown ", "");
      $(this).addClass("active");
      $(".mm-content."+$header_class).addClass("active");
    }
  });


  if (jQuery(window).width() < 767) {

    // Footer Mobile MenuTabs
    $(".footer-header").on("click", function(){
      if($(this).hasClass("active")) {
        $(".footer-content.active,.footer-header.active").removeClass("active");
      }
      else {
        $(".footer-content.active,.footer-header.active").removeClass("active");
        var $header_class = $(this).attr("class").replace("footer-header ", "").replace("dropdown ", "");
        $(this).addClass("active");
        $(".footer-content."+$header_class).addClass("active");
      }
    });

  }

  // Contact page show service & parts
  $(".s-header").on("click", function(){
    if($(this).hasClass("active")) {
      $(".s-content.active,.s-header.active").removeClass("active");
    }
    else {
      $(".s-content.active,.s-header.active").removeClass("active");
      var $header_class = $(this).attr("class").replace("s-header ", "");
      $(this).addClass("active");
      $(".s-content."+$header_class).addClass("active");
    }
  });
  
});

  jQuery(".btn-staff").on("click", function(){
    jQuery(this).parent().find(".staff-bio").toggleClass("show");
  });

